    return(
        <div className={style.container}>
            <div className={style.pContainer}>
                <h1 className={style.title}>Hello!... I'm Cesar, I am a Full Stack  Web Developer.</h1>
                <p>focused on crafting the Tools you are looking for. </p>
            </div>
            <div className={style.imgContainer}><img src={dektop} alt="Cesar" /></div>
        </div>
    )
}

export default Landing;
